  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Union Slough
  NWR outlines Refuge accomplishments from September through December of 1959. The
  report begins by summarizing the weather conditions, habitat conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, furbearers, raptors, and fish- is also covered. The Refuge development
  and maintenance section discusses physical developments, plantings, and vegetation
  control. Resource management is outlined; topics include grazing and fur harvesting.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and hunting. N-R forms and photographs are attached.\",\n\t\"owner_org\":
